import gameSpotLogo from './gameSpotLogo'
import gameSpotDistortion from './gameSpotDistortion'
import gameStopIt from './gameStopIt'
import img from './imgPlayable'
import blowimg from './imgBlowable'
import gameSpotLogoStill from './gameSpotLogoStill'
import gameSpotDistortionStill from './gameSpotDistortionStill'
import gameTimeIt from './gameTimeIt'

var media = img
var blowable = blowimg

export default {
  data: {
    sign_wrong: 'data:image/png;base64,',
    sign_correct: 'data:image/png;base64,',
    gameType: null,
    canvas: null
  },

  setGame (gameType, toolbarTitle, welcomeMessage, timePlaceholder, showLogoOnTime, callCheckGameOver, vid, canvas, animationCanvas) {
    this.gameType = gameType
    switch (gameType) {
      case 'spotlogo':
        toolbarTitle.text(gameSpotLogo.data.gameName)
        welcomeMessage.text(gameSpotLogo.data.welcomeMessage)
        break
      case 'spotdistortion':
        gameSpotDistortionStill.init()
        toolbarTitle.text(gameSpotDistortion.data.gameName)
        welcomeMessage.text(gameSpotDistortion.data.welcomeMessage)
        break
      case 'stopit':
        toolbarTitle.text(gameStopIt.data.gameName)
        welcomeMessage.text(gameStopIt.data.welcomeMessage)
        break
      case 'spotlogostill':
        toolbarTitle.text(gameSpotLogoStill.data.gameName)
        welcomeMessage.text(gameSpotLogoStill.data.welcomeMessage)
        break
      case 'spotdistortionstill':
        gameSpotDistortionStill.init()
        toolbarTitle.text(gameSpotDistortionStill.data.gameName)
        welcomeMessage.text(gameSpotDistortionStill.data.welcomeMessage)
        break
      case 'timeit':
        toolbarTitle.text(gameTimeIt.data.gameName)
        welcomeMessage.text(gameTimeIt.data.welcomeMessage)
        gameTimeIt.setTimePlaceholder(timePlaceholder)
        break
    }
    this.canvas = canvas
    this.animationCanvas = animationCanvas
    // if game is still image
    if (gameType.includes('still')) {
      media = img
      media.setMethods(showLogoOnTime, callCheckGameOver)
    } else media = vid
  },

  setGameDuration (gameDuration) {
    media.setGameDuration(gameDuration)
  },

  setContinuePlayingMessage (welcomeMessage) {
    switch (this.gameType) {
      case 'stopit':
        welcomeMessage.text(gameStopIt.data.continuePlayingMessage)
        break
    }
  },

  play () {
    media.play()
    if (this.gameType === 'timeit') gameTimeIt.showTime()
  },

  pause () {
    media.pause()
    if (this.gameType === 'timeit') gameTimeIt.hideTime()
  },

  destroy () {
    if (this.gameType === 'timeit') gameTimeIt.dismissNotification()
    if (this.gameType.includes('spotdistortion')) gameSpotDistortionStill.destroy()
    this.canvas.hide()
    this.animationCanvas.hide()
    this.pause()
    this.setCurrentTime(0)
  },

  paused () {
    return media.paused
  },

  setCurrentTime (currentTime) {
    media.currentTime = parseFloat(currentTime)
  },

  setCurrentTimeAsync (currentTime, callback) {
    media.currentTime = parseFloat(currentTime)
    console.log('time updated')
    if (!this.gameType.includes('still')) {
      media.addEventListener('canplay', () => {
        console.log('now it is finished')
        if (callback && typeof callback === 'function') {
          callback()
        }
      }, {
        once: true
      })
    }
  },

  getCurrentTime () {
    return media.currentTime
  },

  updateTime () {
    gameTimeIt.updateTime(this.getCurrentTime())
  },

  showTimeItQuestion (q, appearances, maxScreenshotsNumber, showCorrectSign, showMissedSign, loadNextGame) {
    gameTimeIt.showQuestion(q, appearances, maxScreenshotsNumber, showCorrectSign, showMissedSign, loadNextGame, 1, media)
  },

  drawItem (logoImage, jqMedia, logoSize, sx, sy, ratio, distortionSpeed) {
    // console.log('Gams is : ' + this.gameType)
    switch (this.gameType) {
      case 'spotlogo':
      case 'spotlogostill':
        // cancel image, or just relocate/resize
        gameSpotLogo.drawImage(this.canvas, logoImage, logoSize)
        break
      case 'spotdistortion':
      case 'spotdistortionstill':
        // stop animation, or just relocate/resize
        // gameSpotDistortionStill.drawStripeDistortion(this.canvas[0], jqMedia, logoSize, sx, sy, ratio, distortionSpeed)
        gameSpotDistortionStill.drawLiquidDistortion(this.canvas[0], jqMedia, logoSize, sx, sy, ratio, distortionSpeed)
        break
    }
    this.canvas.css('left', sx)
    this.canvas.css('top', sy)
    this.canvas.show()
  },

  drawBlow (blowImage, itemSize, left, top) {
    const animationCanvas = this.animationCanvas
    animationCanvas.show()
    animationCanvas[0].width = itemSize
    animationCanvas[0].height = itemSize
    animationCanvas.width(itemSize)
    animationCanvas.css('left', left)
    animationCanvas.css('top', top)
    var ctx = animationCanvas[0].getContext('2d')
    blowable.setBlow(ctx, blowImage, 4, itemSize)
    blowable.play()
  },

  drawTouch (touchImage, itemSize, left, top) {
    touchImage.width(itemSize)
    touchImage.css('left', left)
    touchImage.css('top', top)
    touchImage.show()
  },

  stopDrawing () {
    // ctx = this.canvas.getContext('2d')
    // ctx.clearRect(0, 0, ctx.width, ctx.height)
    this.canvas.hide()
    gameSpotDistortionStill.stopDrawing()
  },

  timeMatches (appearances, maxScreenshotsNumber, appearanceNumber) {
    var marker = this.getCurrentTime()
    var time = []
    var matchingTime = -1
    for (var i = 1; i <= maxScreenshotsNumber; i++) {
      time[i] = -1
      if (appearances[i] && !appearances[i].answer && marker > appearances[i].startTime && (marker - appearances[i].startTime) < appearances[i].toleranceTime) {
        time[i] = (marker - appearances[i].startTime)
        matchingTime = time[i]
      }
    }
    if (appearanceNumber) {
      return time[appearanceNumber]
    } else {
      return matchingTime
    }
  }

}
